import { Product as ProductInterface } from "../types/Product";

interface CartProps {
  cartItems: ProductInterface[];
}

const Cart: React.FC<CartProps> = ({ cartItems }) => {
  return (
    <div>
      {cartItems.map((eachCartItem) => (
        <div>
          <div>
            <p>{eachCartItem.prodName}</p>
          </div>

          <div>
            <button>-</button>
            <p>1</p>
            <button>+</button>
          </div>

          <div>
            <button>Remove</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Cart;
